B.Bp=new A.lF("Formy",B.MU,B.cP,B.LK,"O Formy representa meu compromisso em construir ferramentas que realmente facilitam a vida dos desenvolvedores, sem abrir m\xe3o de boas pr\xe1ticas como arquitetura limpa, testabilidade e c\xf3digo escal\xe1vel.\n\n\xc9 um projeto que n\xe3o s\xf3 mostra minha capacidade t\xe9cnica em Flutter, mas tamb\xe9m meu cuidado com experi\xeancia do usu\xe1rio, design de API e sustentabilidade de longo prazo.","Biblioteca open source para Flutter desenvolvida para simplificar o gerenciamento de formul\xe1rios complexos com controle total de estado e valida\xe7\xe3o. Criei o pacote do zero com foco em escalabilidade, reatividade e API enxuta, aplicando princ\xedpios de arquitetura limpa e testabilidade. O Formy permite formul\xe1rios din\xe2micos, valida\xe7\xe3o granular e integra\xe7\xe3o fluida com UIs personalizadas.",B.LO,"Projeto pessoal","assets/images/my_logo.png","assets/images/svg/formy.svg","Desenvolvedor Flutter Open Source",null,"Formy \xe9 um pacote open source para Flutter que desenvolvi com o objetivo de simplificar radicalmente o gerenciamento de formul\xe1rios, mantendo flexibilidade e controle total sobre o estado e valida\xe7\xe3o dos campos.\n\nEle nasceu da necessidade de ter uma API enxuta, previs\xedvel e escal\xe1vel para lidar com formul\xe1rios complexos \u2014 desde inputs simples at\xe9 grupos din\xe2micos e depend\xeancias condicionais entre campos.\n\nFoi projetado para funcionar bem em aplica\xe7\xf5es reais, evitando boilerplate e permitindo que desenvolvedores construam interfaces altamente reativas e f\xe1ceis de manter.")
