s($,"b75","aF2",()=>{var q="Gerente da \xe1rea de front-end",p=2025,o="Pesquisador Junior da \xe1rea de front-end"
return A.b([A.CX(A.A0(p,7,9),"Lisandro Tavares da Silva",q,"    Atuei como gerente da \xe1rea de frontend com o Hisnaider como desenvolvedor da minha equipe. Destaco seu grande empenho e contribui\xe7\xe3o ao projeto. Demonstrou forte compromisso em estruturar um ambiente de trabalho focado na entrega eficiente das demandas do cliente, sempre prezando por um c\xf3digo limpo, simples e manuten\xedvel, seguindo boas pr\xe1ticas e padr\xf5es de desenvolvimento.\n    Ele se mostrou altamente propositivo, com iniciativa e postura construtiva. Atuou como l\xedder t\xe9cnico, apoiando e ensinando colegas menos experientes com muito dedica\xe7\xe3o.\n    \xc9 um excelente desenvolvedor, sens\xedvel \xe0s necessidades da equipe, do cliente e da gest\xe3o."),A.CX(A.A0(p,7,7),"Carlos Alberto Madsen",q,"    Trabalhei com o Hisnaider no projeto Plena, desenvolvido pelo iTEC FURG/Unidade Embrapii, ao longo de 15 meses. Durante esse per\xedodo, colaboramos no desenvolvimento do aplicativo Raquel Menopausa, utilizando a linguagem Dart e o framework Flutter para a constru\xe7\xe3o do front-end.\n    Al\xe9m de demonstrar s\xf3lido conhecimento t\xe9cnico, Hisnaider se destacou pelo empenho, responsabilidade, capacidade de resolver problemas e excelente relacionamento interpessoal com toda a equipe.\n    O time era composto por cinco bolsistas de inicia\xe7\xe3o cient\xedfica, que no in\xedcio tinham pouco ou nenhum conhecimento em Flutter. Hisnaider sempre se mostrou dispon\xedvel para orientar, compartilhar conhecimento e esclarecer d\xfavidas. Gra\xe7as \xe0 sua dedica\xe7\xe3o, todos n\xf3s evolu\xedmos profissionalmente ao longo do projeto.\n    Na minha vis\xe3o, um dos principais diferenciais da sua atua\xe7\xe3o foi a defini\xe7\xe3o da arquitetura do aplicativo. A qualidade com que estruturou o projeto foi fundamental para que o restante da equipe pudesse desenvolver suas tarefas com efici\xeancia, al\xe9m de garantir um c\xf3digo limpo e de f\xe1cil manuten\xe7\xe3o."),A.CX(A.A0(p,7,8),"Diogo Paludo de Oliveira","Gerente da \xe1rea de back-end","    Tive a oportunidade de trabalhar com Hisnaider no desenvolvimento de um projeto voltado \xe0 sa\xfade feminina, que contou com uma equipe multidisciplinar e diversas frentes t\xe9cnicas. Atuando como desenvolvedor front-end, ele foi respons\xe1vel por liderar a execu\xe7\xe3o das a\xe7\xf5es da equipe de Flutter, composta por cinco integrantes, sempre com um olhar atento \xe0 qualidade do c\xf3digo e \xe0 experi\xeancia do usu\xe1rio.\n    Sua condu\xe7\xe3o t\xe9cnica foi excelente, seja pelas boas pr\xe1ticas ou pela aplica\xe7\xe3o consistente de princ\xedpios de clean code, organiza\xe7\xe3o de reposit\xf3rio e aten\xe7\xe3o \xe0 reusabilidade de interfaces da aplica\xe7\xe3o. Seu comprometimento e compet\xeancia foram fundamentais para entregar um produto robusto e bem estruturado. Recomendo fortemente seu trabalho!"),A.CX(A.A0(p,7,7),"Gabriel Provin Flores Endres",o,"    Recomendo fortemente o Hisnaider pelo excelente trabalho no projeto Raquelmenopausa. Ele estruturou toda a arquitetura da aplica\xe7\xe3o com muita compet\xeancia e criou bibliotecas, seguindo boas pr\xe1ticas de desenvolvimento e organiza\xe7\xe3o. Al\xe9m disso, foi fundamental no apoio ao time, compartilhando conhecimento e promovendo o uso eficiente do GitHub ao longo de todo o projeto."),A.CX(A.A0(p,7,7),"Pablo Guaicurus",o,"    Hisnaider foi um cara que me ensinou muito. Ele n\xe3o era o l\xedder t\xe9cnico, tampouco o que tinha o cargo de maior senioridade, mas fez essas fun\xe7\xf5es de forma incr\xedvel! \n    Recomendo-o por seu comprometimento com o servi\xe7o e sua capacidade de ajudar os colegas quando eles mais precisam. \xc9 um cara que faz bem pra qualquer time. \xc9 competente no desenvolvimento e capaz de tocar grandes projetos de forma independente."),A.CX(A.A0(p,7,9),"Mikael Farias","Pesquisador Junior da \xe1rea de vis\xe3o computacional","    Hisnaider \xe9 um excelente profissional, com s\xf3lidos conhecimentos em Flutter e desenvolvimento mobile. Tem \xf3tima comunica\xe7\xe3o e trabalha muito bem em equipe. Sem d\xfavida, t\xea-lo na equipe ser\xe1 um grande diferencial t\xe9cnico.")],A.ai("t<Q2>"))})
